// frontend/src/App.js

import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import SearchComponent from './components/SearchComponent';
import AddDocumentComponent from './components/AddDocumentComponent';
import DocumentListComponent from './components/DocumentListComponent';
import TaxCalculatorComponent from './components/TaxCalculatorComponent';
import EditDocumentComponent from './components/EditDocumentComponent';
import DeleteDocumentComponent from './components/DeleteDocumentComponent';
import LoginComponent from './components/LoginComponent';
import ChatBotComponent from './components/ChatBotComponent';
import OCRComponent from './components/OCRComponent';

function App() {
    return (
        <Router>
            <div className="App container mt-5">
                <h1 className="text-center">AI-Tax-Azad System</h1>
                <Routes>
                    <Route path="/" element={<LoginComponent />} />
                    <Route path="/search" element={<SearchComponent />} />
                    <Route path="/add-document" element={<AddDocumentComponent />} />
                    <Route path="/documents" element={<DocumentListComponent />} />
                    <Route path="/edit-document" element={<EditDocumentComponent />} />
                    <Route path="/delete-document" element={<DeleteDocumentComponent />} />
                    <Route path="/tax-calculator" element={<TaxCalculatorComponent />} />
                    <Route path="/chatbot" element={<ChatBotComponent />} />
                    <Route path="/ocr" element={<OCRComponent />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
